import React, { useEffect } from "react";
import {Box, Button, Typography} from "@material-ui/core"
import {Link} from "react-router-dom"
import "./Nav.css"
import LoginService from "../services/LoginService";

export const Nav: React.FC = props => {
    const [logged, setLogged] = React.useState(false);
    const [email, setEmail] = React.useState("");

    let history = useHistory();

    useEffect( () => {
        const val = LoginService.isLogged();

        if (val !== ""){
            setLogged(true);
            setEmail(val);
        }
        else{
            setLogged(false);
        }
    }, [logged]);

    const handleLogOut = () => {
        let allCookies = document.cookie.split(";");
        for (let i = 0; i < allCookies.length; i++)
            document.cookie =
                allCookies[i] + "=;expires=" + new Date(0).toUTCString();
        window.location = "/";
    }

    return (
        <Box style={{display:"flex", justifyContent: "space-between", alignItems:"space-between", width: "100%", padding:"2vh 0vh 0vh 0vh", backgroundColor: "grey"}}>
            <Link to={"/"}>
                <Typography variant={"h5"}>Home</Typography>
            </Link>

            <div style={{ display: "flex", justifyContent: "space-between"}}>
                { logged ?
                    <p>{email}</p>
                    :
                    <Button component={Link} to="/login" className="button" variant="contained">Zaloguj się</Button>
                }
                { logged ?
                    <Button component={Link} to="/register" className="button" variant="contained">Wyloguj się</Button>
                    :
                    <Button component={Link} to="/register" className="button" variant="contained">Zarejestruj się</Button>
                }
                </div>
        </Box>
    )
}
